// src/components/Wishlist.js
import React from "react";
import "./ishlist.css"; // Import the CSS for Wishlist

const Wishlist = () => {
  return (
    <div className="wishlist-page">
      <h2>Wishlist</h2>
      <p>Your wishlist is currently empty.</p>
    </div>
  );
};

export default Wishlist;
